amer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>Graphical User Interface</strong> (GUI) (20 Credits)</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>Programming Concepts and Java for Android Programming</strong> (20 Credits)</li>\r\n</ul>\r\n<p class=\"framer-text framer-styles-preset-1ahpl9\">Discover the various&nbsp;<strong class=\"framer-text\">pathways and course combinations</strong> available to tailor your learning experience and achieve your goals. Click <a class=\"framer-text framer-styles-preset-9a0981\" href=\"https://drive.google.com/file/d/1rtvk1HMDWcuxHztTRBuntCW7F4Yb8gCF/view?usp=sharing\" target=\"_blank\" rel=\"noopener\"><strong class=\"framer-text\">here</strong></a> to explore more information on your options.*</p>\r\n<p class=\"framer-text framer-styles-preset-1ahpl9\">Explore the <strong class=\"framer-text\">complete curriculum</strong> for this course to gain a detailed understanding of the topics covered, learning objectives, and key skills you\'ll develop. Click <a class=\"framer-text framer-styles-preset-9a0981\" href=\"https://drive.google.com/file/d/1_8GZiuZT3_Knmb8DhTYvd7TJI4A_JSt3/view?usp=sharing\" target=\"_blank\" rel=\"noopener\"><strong class=\"framer-text\">here</strong></a> to access the full curriculum.</p>\r\n<p class=\"framer-text framer-styles-preset-1ahpl9\"><em class=\"framer-text\">*Note: Some combinations of electives are restricted to avoid overlap with specialised qualifications in Networking, Web Design, or E-commerce.</em></p>\r\n<h4 class=\"framer-text framer-styles-preset-12a1e5m\">Guidance on Elective Selection</h4>\r\n<p class=\"framer-text framer-styles-preset-1ahpl9\">Learners are encouraged to consult with the Student Advisor Office to choose electives that align with their career goals and maximise both academic and practical performance. The Student Advisor Office provides personalised guidance to ensure optimal elective selections for skill development and professional growth.</p>','<h4 class=\"framer-text framer-styles-preset-12a1e5m\">Aims of the Diploma</h4>\r\n<p class=\"framer-text framer-styles-preset-1ahpl9\">The diploma aims to:</p>\r\n<ul class=\"framer-text\">\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Develop technical knowledge in core areas of IT, including operating systems, ethics, and database management.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Enable learners to apply analytical and evaluative skills in a variety of IT contexts.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Support progression into technical positions or higher-level IT study pathways.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Enhance skills such as problem-solving, independent research, and collaboration, critical to the IT sector.</li>\r\n</ul>',7750,150,1,1,'active',1,'2025-06-13 07:53:59','2025-06-19 12:24:53',1),(3,'Law','Law',8,2,'603/4781/8','120 ECTS','uploads/courses/course_thumbnail_684feb04b87b8.jpg','uploads/courses/course_logo_684feb04b8a54.jpg','uploads/courses/handbook_684bf5372ad5f.pdf','uploads/courses/mapping_document_684bf5372af73.pdf','uploads/courses/assignment_specification_684bf5372b15a.pdf','uploads/courses/curriculum_684bf5372b315.pdf','youtube','https://youtu.be/sVPYIRF9RCQ?si=labNkx-xlyOWtptr','<p>test</p>','<p>The Level 4 Diploma in Information Technology is designed to provide learners with a strong foundational knowledge across key areas of IT, including PC maintenance, programming, and database management. This diploma equips students for entry-level IT roles or progression to higher-level studies in specialised fields such as networking, software development, and web design. It combines practical and theoretical learning to foster essential technical skills for the modern IT industry.</p>','<h4 class=\"framer-text framer-styles-preset-12a1e5m\">Aims of the Diploma</h4>\r\n<p class=\"framer-text framer-styles-preset-1ahpl9\">The diploma aims to:</p>\r\n<ul class=\"framer-text\">\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Develop technical knowledge in core areas of IT, including operating systems, ethics, and database management.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Enable learners to apply analytical and evaluative skills in a variety of IT contexts.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Support progression into technical positions or higher-level IT study pathways.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Enhance skills such as problem-solving, independent research, and collaboration, critical to the IT sector.</li>\r\n</ul>\r\n<hr>\r\n<h4 class=\"framer-text framer-styles-preset-12a1e5m\">Learning Outcomes</h4>\r\n<p class=\"framer-text framer-styles-preset-1ahpl9\">Upon successful completion, learners will be able to:</p>\r\n<ol class=\"framer-text\">\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Apply principles of IT ethics and management in professional scenarios.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Demonstrate understanding of mathematics and statistics within IT applications.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Perform PC maintenance and manage operating systems effectively.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Utilise database management skills to organise and process data securely.</li>\r\n</ol>\r\n<hr>\r\n<h4 class=\"framer-text framer-styles-preset-12a1e5m\">Duration</h4>\r\n<ul class=\"framer-text\">\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>Full-Time</strong>: 1 Year</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>Part-Time</strong>: 2 Years</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>Maximum Completion</strong>: 5 Years from Enrolment</li>\r\n</ul>\r\n<hr>\r\n<h4 class=\"framer-text framer-styles-preset-1ahpl9\"><strong class=\"framer-text\">Mode of Delivery</strong></h4>\r\n<ul class=\"framer-text\">\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Distance Education</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Self-Paced Learning</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Course Materials: Video and Text Resources</li>\r\n</ul>\r\n<hr>\r\n<h3 class=\"framer-text framer-styles-preset-gjgtvi\">Admission Requirements</h3>\r\n<ul class=\"framer-text\">\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>Typical Age</strong>: 18+</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>Prior Qualifications</strong>: &nbsp;A GCE Advanced level profile with achievement in 2 or more subjects, a Level 3 qualification in IT or a related field, or an Access to Higher Education Certificate from an approved institution.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>International Qualifications</strong>: Equivalent qualifications may include: High school diplomas or equivalent secondary qualifications in Asia, Africa, Europe, and the Americas.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>English Proficiency</strong> (for non-native speakers): IELTS 5.5, CEFR level B2, or equivalent​.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>Additional Guidance</strong> : For assistance with qualification equivalency or language requirements, please contact our admissions advisor at <a class=\"framer-text framer-styles-preset-9a0981\" href=\"mailto:admission@contact.info\" rel=\"noopener\">admissions@richmondcollege.co.uk</a> or through our <a class=\"framer-text framer-styles-preset-9a0981\" href=\"https://www.richmondcollege.co.uk/contact\">contact page</a>.</li>\r\n</ul>\r\n<hr>\r\n<h3 class=\"framer-text framer-styles-preset-gjgtvi\">Structure of the Qualification</h3>\r\n<p class=\"framer-text framer-styles-preset-1ahpl9\"><strong class=\"framer-text\">Total Credits</strong>: 120 ECTS<br class=\"framer-text\"><strong class=\"framer-text\">Modules</strong>: Learners must complete four core units and select two electives, achieving a total of 120 credits.</p>\r\n<h4 class=\"framer-text framer-styles-preset-12a1e5m\">Core Modules</h4>\r\n<ol class=\"framer-text\">\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>Information Technology and IT Ethics </strong>(20 Credits) : Covers fundamental IT concepts and ethical issues.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>Mathematics and Statistics for IT</strong> (20 Credits) : Introduces mathematical and statistical tools relevant to IT applications.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>PC Maintenance and Operating Systems</strong> (20 Credits) : Focuses on hardware, software maintenance, and troubleshooting.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>Computer Graphics Editing and Database Concepts </strong>(20 Credits) : Addresses database management and essential graphics editing techniques.</li>\r\n</ol>\r\n<h4 class=\"framer-text framer-styles-preset-12a1e5m\">Elective Modules</h4>\r\n<p class=\"framer-text framer-styles-preset-1ahpl9\">Choose any two from the following electives:</p>\r\n<ul class=\"framer-text\">\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>Logical IT Networking </strong>(20 Credits)</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>Physical IT Networking </strong>(20 Credits)</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>Web Design 1 </strong>(20 Credits)</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>Web Programming</strong> (20 Credits)</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>Graphical User Interface</strong> (GUI) (20 Credits)</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\"><strong>Programming Concepts and Java for Android Programming</strong> (20 Credits)</li>\r\n</ul>\r\n<p class=\"framer-text framer-styles-preset-1ahpl9\">Discover the various&nbsp;<strong class=\"framer-text\">pathways and course combinations</strong> available to tailor your learning experience and achieve your goals. Click <a class=\"framer-text framer-styles-preset-9a0981\" href=\"https://drive.google.com/file/d/1rtvk1HMDWcuxHztTRBuntCW7F4Yb8gCF/view?usp=sharing\" target=\"_blank\" rel=\"noopener\"><strong class=\"framer-text\">here</strong></a> to explore more information on your options.*</p>\r\n<p class=\"framer-text framer-styles-preset-1ahpl9\">Explore the <strong class=\"framer-text\">complete curriculum</strong> for this course to gain a detailed understanding of the topics covered, learning objectives, and key skills you\'ll develop. Click <a class=\"framer-text framer-styles-preset-9a0981\" href=\"https://drive.google.com/file/d/1_8GZiuZT3_Knmb8DhTYvd7TJI4A_JSt3/view?usp=sharing\" target=\"_blank\" rel=\"noopener\"><strong class=\"framer-text\">here</strong></a> to access the full curriculum.</p>\r\n<p class=\"framer-text framer-styles-preset-1ahpl9\"><em class=\"framer-text\">*Note: Some combinations of electives are restricted to avoid overlap with specialised qualifications in Networking, Web Design, or E-commerce.</em></p>\r\n<h4 class=\"framer-text framer-styles-preset-12a1e5m\">Guidance on Elective Selection</h4>\r\n<p class=\"framer-text framer-styles-preset-1ahpl9\">Learners are encouraged to consult with the Student Advisor Office to choose electives that align with their career goals and maximise both academic and practical performance. The Student Advisor Office provides personalised guidance to ensure optimal elective selections for skill development and professional growth.</p>','<h4 class=\"framer-text framer-styles-preset-12a1e5m\">Aims of the Diploma</h4>\r\n<p class=\"framer-text framer-styles-preset-1ahpl9\">The diploma aims to:</p>\r\n<ul class=\"framer-text\">\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Develop technical knowledge in core areas of IT, including operating systems, ethics, and database management.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Enable learners to apply analytical and evaluative skills in a variety of IT contexts.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Support progression into technical positions or higher-level IT study pathways.</li>\r\n<li class=\"framer-text framer-styles-preset-1ahpl9\" data-preset-tag=\"p\">Enhance skills such as problem-solving, independent research, and collaboration, critical to the IT sector.</li>\r\n</ul>',7850,150,1,1,'active',1,'2025-06-13 07:53:59','2025-06-19 12:25:05',1),(4,'Computing','Computing',8,2,'603/4781/8','120 ECTS','uploads/courses/course_thumbnail_685ae07b6d70b.jpg','uploads/courses/course_logo_685ae07b6da38.jpg','uploads/courses/handbook_684bf5372ad5f.pdf','uploads/courses/mapping_document_684bf5372af73.pdf','uploads/courses/assignment_specification_684bf5372b15a.pdf','uploads/courses/curriculum_684bf5372b315.pdf','youtube','https://youtu.be/sVPYIRF9RCQ?si=labNkx-xlyOWtptr','<p>test</p>','<p>The Level 4 Diploma in Information Technology is designed to provide le